#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  http_parser parser;
  http_parser_init(&parser, HTTP_BOTH);
  http_parser_pause(&parser, 1);

  return 0;
}

#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>
#include <string.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  http_parser parser;
  http_parser_init(&parser, HTTP_BOTH);
  unsigned int flag = 1;

  if (size > 2) {
    flag = data[0] % 2;
    http_parser_pause(&parser, flag);
  }

  return 0;
}
